import React, { useState } from "react";
import cartIcon from '../../icons/cart.svg';
export default function ShowButtonHover() {
    const [style, setStyle] = useState({ display: 'none' });
    const [modalViewer,setModalViewer] =useState({display:'none'});
    return (
        <div>
            <div onMouseEnter={e => {
                setModalViewer = ({ display: 'block' })
            }}
                onMouseLeave={e => {
                    setModalViewer = ({ display: 'none' })
                }}><img src={cartIcon} height={30} width={30} />
                <button style={modalViewer}>hello</button>
            </div>
        </div>
    );
}
